import React from "react";

import HeaderTwo from "../components/HeaderTwo";
import ShippingTwo from "../components/ShippingTwo";
import FooterTwo from "../components/FooterTwo";

const ShopPage = () => {

  return (
    <>
      

      {/* HeaderOne */}
      <HeaderTwo category={true} />

      

      {/* ShippingTwo */}
      <ShippingTwo />

      {/* FooterTwo */}
      <FooterTwo />


    </>
  );
};

export default ShopPage;
